<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8" />
    <title>Vue2 Table</title>
    <link rel="stylesheet" href="resources/css/style.css" />
</head>
<body>

    <div id="myApp" v-cloak>
        <div class="filters">
            <input type="text" name="q" placeholder="Search for..." autocomplete="off" class="filters__search" v-model="searchQuery" />

            <div class="filters__limit">
                Show
                <select v-model="perPage" @change="checkPageNum">
                    <option value="10">10</option>
                    <option value="25">25</option>
                    <option value="50">50</option>
                    <option value="100">100</option>
                </select>
                Entries
            </div>
        </div>

        <table>
            <thead>
                <tr>
                    <th :class=" { 'sorted' : 'id' === sortBy, 'sorted--desc' : 'id' === sortBy && 'DESC' === sortDir }" @click="sort('id')">ID</th>
                    <th :class=" { 'sorted' : 'first_name' === sortBy, 'sorted--desc' : 'first_name' === sortBy && 'DESC' === sortDir }" @click="sort('first_name')">Name</th>
                    <th :class=" { 'sorted' : 'city' === sortBy, 'sorted--desc' : 'city' === sortBy && 'DESC' === sortDir }" @click="sort('city')">City</th>
                    <th :class=" { 'sorted' : 'country' === sortBy, 'sorted--desc' : 'country' === sortBy && 'DESC' === sortDir }" @click="sort('country')">Country</th>
                </tr>
            </thead>
            <tbody>
                <tr v-for="customer in customerList">
                    <td>{{ customer.id }}
                    <td>{{ customer.first_name }} {{ customer.last_name }}</td>
                    <td>{{ customer.city }}</td>
                    <td>{{ customer.country }}</td>
                </tr>
            </tbody>
        </table>

        <div class="paginate" v-if="pages > 1">
            <span class="paginate__button" v-if="currentPage > 0" @click="currentPage = currentPage - 1">&laquo; Prev</span>

            <span v-if="index == 0 || (index > startPage && index < endPage) || index == pages" v-for="(index, i) in pages">
                <span class="paginate__button" v-if="startPage > 1 && i === startPage" @click="currentPage = 0">1</span>
                <span v-if="index > endPage && endPage || startPage > 1 && i === startPage">...</span>
                <strong v-if="currentPage == index - 1" @click="currentPage = index - 1">{{ index }}</strong>
                <span class="paginate__button" v-else @click="currentPage = index - 1">{{ index }}</span>
            </span>

            <span class="paginate__button" v-if="currentPage < pages - 1" @click="currentPage++">Next &raquo;</span>
        </div>
    </div>

